import React from 'react'
import { Col, Container, Row } from 'react-bootstrap'
// import Facebook from '../../icons/Social'
import Social from '../../icons/Social'
import './Footer.css'
export default function Footer() {
    return (
        // <footer>
        //     <Container>
        //         <div className="footer-box">
        //         <Row>
        //             <Col><img className='logo' src="logo.jpg" alt="" /></Col>
        //             <Col>
        //                 <h2>Address</h2>
        //                 <h3>Lorem ipsum dolor sit amet consectetur.</h3>
        //             </Col>
        //             <Col>
        //                 <h2 id='contact'>Contact us</h2>
        //                 <div class="social-container">
        //                     <a href="https://www.facebook.com" target="_blank" rel="noreferrer">
        //                         <Social className='icons' name='facebook'></Social>
        //                     </a>
        //                     <a href="https://www.instagram.com" target="_blank" rel="noreferrer">
        //                     <Social className='icons' name='instagram'></Social>
        //                     </a>

        //                 </div>
        //             </Col>
        //         </Row>
        //         </div>
        //     </Container>
        // </footer>

        <footer id="footer" class="footer-1">
            <div class="main-footer widgets-dark typo-light">
                <div class="container">
                    <div class="row">

                        <div class="col-xs-12 col-sm-6 col-md-3">
                            <div class="widget subscribe no-box">
                                <h5 class="widget-title">COMPANY NAME</h5>
                                <img className='logo' src="logo.jpg" alt="" />
                                <span></span>
                                <p>About the company, little description will goes here.. </p>
                            </div>
                        </div>


                        <div class="col-xs-12 col-sm-6 col-md-3">
                            <div class="widget no-box">
                                <h5 class="widget-title">Quick Links<span></span></h5>
                                <ul class="thumbnail-widget">
                                    <li>
                                        <div class="thumb-content"><a href="#.">&nbsp;Get Started</a></div>
                                    </li>
                                    <li>
                                        <div class="thumb-content"><a href="#.">&nbsp;Top Leaders</a></div>
                                    </li>

                                </ul>
                            </div>
                        </div>



                        <div class="col-xs-12 col-sm-6 col-md-3">
                            <div class="widget no-box">
                                <h5 class="widget-title">Follow up<span></span></h5>
                                <a href="#"> <i class="fa fa-facebook"> </i> </a>
                                <a href="#"> <i class="fa fa-twitter"> </i> </a>
                                <a href="#"> <i class="fa fa-youtube"> </i> </a>
                            </div>
                        </div>
                        {/* <br />
                        <br /> */}


                        <div class="col-xs-12 col-sm-6 col-md-3">
                            <div class="widget no-box">
                                <h5 class="widget-title">Contact Us<span></span></h5>
                                <p>Lorem ipsum dolor sit, amet consectetur adipisicing elit.</p>
                                <div class="emailfield">
                                    <form>
                                    <input type="text" name="email" value="Email" />
                                    <input name="uri" type="hidden" value="arabiantheme" />
                                    <input name="loc" type="hidden" value="en_US" />
                                    <input class="submitbutton ripplelink" type="submit" value="Subscribe" />
                                </form>
                            </div>
                        </div>
</div>
                    </div>
                </div>
            </div>

            <div class="footer-copyright">
                <div class="container">
                    <div class="row">
                        <div class="col-md-12 text-center">
                            <p>Copyright Design Sherif Hamdy © 2019. All rights reserved.</p>
                        </div>
                    </div>
                </div>
            </div>
        </footer>


    );
}
